import{_ as e,o as l,c as i,a}from"./app.57a3dbd1.js";const f=JSON.parse('{"title":"控件获取","description":"","frontmatter":{"contributors":["ZhouYixun"]},"headers":[{"level":2,"title":"原生控件","slug":"原生控件","link":"#原生控件","children":[]},{"level":2,"title":"POCO控件","slug":"poco控件","link":"#poco控件","children":[]},{"level":2,"title":"左侧区域","slug":"左侧区域","link":"#左侧区域","children":[]},{"level":2,"title":"中间区域","slug":"中间区域","link":"#中间区域","children":[]},{"level":2,"title":"右侧区域","slug":"右侧区域","link":"#右侧区域","children":[]}],"relativePath":"doc/doc-element.md","lastUpdated":1716537034000}'),t={name:"doc/doc-element.md"},o=a('<h1 id="控件获取" tabindex="-1">控件获取 <a class="header-anchor" href="#控件获取" aria-hidden="true">#</a></h1><p>获取控件的使用说明。</p><h2 id="原生控件" tabindex="-1">原生控件 <a class="header-anchor" href="#原生控件" aria-hidden="true">#</a></h2><p>先确保您的Driver已正常启动。</p><p>获取方法：</p><ol><li>点击【获取控件元素】</li><li>获取完毕！</li></ol><h2 id="poco控件" tabindex="-1">POCO控件 <a class="header-anchor" href="#poco控件" aria-hidden="true">#</a></h2><p>目前Sonic已支持游戏自动化的引擎有：</p><ol><li>Unity3D</li><li>UE4</li><li>Egret</li><li>Cocos2dx-js</li><li>Cocos2dx-lua</li><li>Cocos2dx-c++</li><li>cocos-creator</li></ol><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>接入POCO-SDK时，如果有更改默认的socket启动端口，可以在 Default Port 中指定连接端口的值。</p></div><p>获取方法：</p><ol><li>被测控件类型为游戏控件</li><li>对应游戏包已经接入POCO-SDK。 👉<a href="https://poco.readthedocs.io/en/latest/source/doc/integration.html" target="_blank" rel="noreferrer">POCO官方接入指南</a></li><li>已经打开接入SDK的对应引擎页面。</li><li>点击【获取控件元素】</li><li>获取完毕！</li></ol><h2 id="左侧区域" tabindex="-1">左侧区域 <a class="header-anchor" href="#左侧区域" aria-hidden="true">#</a></h2><p>左侧区域为实时截图，点击对应区域，会在中间区域展示对应坐标下控件在控件树中的位置。同时右侧区域会展示对应控件的详细信息。</p><h2 id="中间区域" tabindex="-1">中间区域 <a class="header-anchor" href="#中间区域" aria-hidden="true">#</a></h2><p>中间区域为实时控件树的层级结构，可以点击对应层级，左侧区域会将对应控件的区块变色展示。同时右侧区域会展示对应控件的详细信息。</p><h2 id="右侧区域" tabindex="-1">右侧区域 <a class="header-anchor" href="#右侧区域" aria-hidden="true">#</a></h2><p>右侧区域为控件详细信息，如果在【UI自动化】中或在此处关联了项目，即可将控件信息保存到项目中，然后在自动化中直接引用。如果需用作于图像识别相关，可以使用【控件快照】直接保存。</p>',18),r=[o];function c(d,n,s,h,p,_){return l(),i("div",null,r)}const m=e(t,[["render",c]]);export{f as __pageData,m as default};
